import "./Footer.css";
import logoInstagram from "./akar-icons_instagram-fill.png";
import logoFacebook from "./icon-park-outline_facebook.png";
import logoTiktok from "./ph_tiktok-logo.png";
import Images from "../../img/Images";
const Footer = () => {
  return (
    <footer>
      {/* <span>IMAGEN</span> */}
      <img src={Images.LogoFooter} alt="" />
      <ul className="footer-phone">
        <li>Llamada importante 1</li>
        <li>Llamada importante 1</li>
        <li>Llamada importante 1</li>
        <li>Llamada importante 1</li>
      </ul>
      <ul className="footer-img">
        <li>
          {" "}
          <img src={logoFacebook} alt="Facebook" />
        </li>
        <li>
          <img src={logoInstagram} alt="Instagram" />
        </li>
        <li>
          <img src={logoTiktok} alt="Tiktok" />
        </li>
      </ul>
    </footer>
  );
};

export default Footer;
